(27, 5, '234234', '234234', '234324234', '<p style=\'box-sizing: inherit; margin-right: 0px; margin-bottom: 1.75rem; margin-left: 0px; color: rgb(51, 51, 51); font-family: \"noto sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 18px;\'>Laravel summernote image upload example tutorial, here you will learn how to use upload image file with summernote in laravel apps.<p style=\'box-sizing: inherit; margin-right: 0px; margin-bottom: 1.75rem; margin-left: 0px; color: rgb(51, 51, 51); font-family: \"noto sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 18px;\'>If you are searching how to image file upload in sumernote editor laravel application. So this laravel summernote editor in image file upload laravel app tutorial will help you to upload images in summernote editor example.</p><p style=\'box-sizing: inherit; margin-right: 0px; margin-bottom: 1.75rem; margin-left: 0px; color: rgb(51, 51, 51); font-family: \"noto sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 18px;\'>This laravel summernote example guides you step by step on how to upload image with&nbsp;<span style=\"box-sizing: inherit; font-weight: bolder;\">summernote wysiwyg editor</span>&nbsp;in laravel apps.</p><p style=\'box-sizing: inherit; margin-right: 0px; margin-bottom: 1.75rem; margin-left: 0px; color: rgb(51, 51, 51); font-family: \"noto sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 18px;\'><img data-filename=\"1.jpg\" style=\"width: 1136.2px;\" src=\"http://localhost:8000/summernoteimages/5f709ceb82139.jpeg\"></p><p style=\'box-sizing: inherit; margin-right: 0px; margin-bottom: 1.75rem; margin-left: 0px; color: rgb(51, 51, 51); font-family: \"noto sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 18px;\'>Follow the below following 7 steps and upload image with summernote editor in laravel apps:</p><ul style=\'box-sizing: inherit; margin-right: 0px; margin-bottom: 1.75rem; margin-left: 0px; padding: 0px 0px 0px 1.75em; color: rgb(51, 51, 51); font-family: \"noto sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 18px;\'><li style=\"box-sizing: inherit;\">Step 1: Install Laravel App</li><li style=\"box-sizing: inherit;\">Step 2: Add Database Details</li><li style=\"box-sizing: inherit;\">Step 3: Create Migration and Model File</li><li style=\"box-sizing: inherit;\">Step 4: Add Routes</li><li style=\"box-sizing: inherit;\">Step 5: Create Controller</li><li style=\"box-sizing: inherit;\">Step 6: Create Blade File</li><li style=\"box-sizing: inherit;\">Step 7: Run Development Server</li></ul><h3 style=\'box-sizing: inherit; font-family: \"source sans pro\", \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-weight: 700; margin-right: 0px; margin-bottom: 1.75rem; margin-left: 0px; color: rgb(51, 51, 51);\'>Step 1: Install Laravel App</h3><p style=\'box-sizing: inherit; margin-right: 0px; margin-bottom: 1.75rem; margin-left: 0px; color: rgb(51, 51, 51); font-family: \"noto sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 18px;\'>In this step, open a terminal and run the following command. This command will install or download laravel fresh application setup for implementing image upload with summernote editor in laravel app:</p></p>\n', '5.jpg', 1, 12, '2020-09-27 06:08:43', '2020-09-27 06:10:45'),
