(32, 3, 'hello', 'hey there eeee', 'hi', '<p style=\'margin-right: 0px; margin-bottom: 17px; margin-left: 0px; color: rgb(34, 34, 34); font-family: \"Open Sans\"; font-size: 15px; text-align: justify;\'><span style=\"font-size: 12pt;\">Intervention Image has optional support for&nbsp;<a href=\"http://laravel.com/\" style=\"color: rgb(0, 128, 206); transition: all 0.4s ease 0s;\">Laravel</a>&nbsp;and comes with a&nbsp;<span style=\"font-weight: 700;\">Service Provider and Facades</span>&nbsp;for easy integration. The&nbsp;<span style=\"font-weight: 700;\">vendor/autoload.php</span>&nbsp;file is included by Laravel, so you don&acirc;&#128;&#153;t have to require or autoload manually.&nbsp;</span><span style=\"font-size: 12pt;\">We use Laravel 7. Also, I have used the<span style=\"font-weight: 700;\">&nbsp;intervention/image</span>&nbsp;package to resize the image and then save the image into the database. We generally have the use cases like&nbsp;<a href=\"https://appdividend.com/2018/06/02/laravel-avatar-image-upload-tutorial-with-example/\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"color: rgb(0, 128, 206); transition: all 0.4s ease 0s;\">upload an avatar</a>&nbsp;or&nbsp;<a href=\"https://appdividend.com/2018/02/05/laravel-multiple-images-upload-tutorial/\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"color: rgb(0, 128, 206); transition: all 0.4s ease 0s;\">upload a product image</a>&nbsp;of a specific size on an e-commerce website. So&nbsp;<span style=\"font-weight: 700;\">intervention/image&nbsp;</span>package is used to upload and resize the images.</span><span id=\"ezoic-pub-ad-placeholder-127\" class=\"ezoic-adpicker-ad\"></span><h2 style=\"font-family: Roboto; line-height: 1.3; color: rgb(45, 45, 45); margin-top: 20px; margin-bottom: 10px; font-size: 30px; text-align: justify;\"><span style=\"font-weight: 700;\"><span style=\"color: rgb(153, 51, 0);\">Laravel Image Intervention</span></span></h2><p style=\'margin-right: 0px; margin-bottom: 17px; margin-left: 0px; color: rgb(34, 34, 34); font-family: \"Open Sans\"; font-size: 15px;\'><span style=\"font-size: 12pt;\">Intervention Image requires the following components to work correctly.</span></p><ol style=\'margin-bottom: 17px; color: rgb(34, 34, 34); font-family: \"Open Sans\"; font-size: 15px;\'><li><span style=\"font-size: 12pt;\">PHP &gt;= 5.4</span></li><li><span style=\"font-size: 12pt;\">Fileinfo Extension</span><img data-filename=\"3.jpg\" style=\"width: 1136.2px;\" src=\"http://localhost:8000/summernoteimages/5f718dd2e0955.jpeg\"></li></ol></p>\n', '16012773948.jpg', 1, 63, '2020-09-27 23:16:35', '2020-10-01 05:21:06'),
